    /**
     * Gets the attribute value for TAX_AMOUNT using the alias name TaxAmount.
     * @return the TAX_AMOUNT
     */
    public BigDecimal getTaxAmount() {
        BigDecimal taxRate =getTaxRate()==null?new BigDecimal(0):this.getTaxRate();
        BigDecimal bookingAmt =getBookingAmount()==null?new BigDecimal(0):this.getBookingAmount();
        BigDecimal discAmt =getDiscAmount()==null?new BigDecimal(0):this.getDiscAmount();
         
        BigDecimal balanceAmt=bookingAmt.subtract(discAmt);       
        BigDecimal taxAmt=(taxRate.multiply(balanceAmt).divide(new BigDecimal(100)));
        
        return taxAmt;
        //        return (BigDecimal) getAttributeInternal(TAXAMOUNT);
    }

